import pepito from './logo.svg';
import './App.css';
import Button from '@mui/material/Button';
import * as React from 'react';

function App() {


  const [valor, setValor] = React.useState(10);

  function incrementar(){
    setValor((valor) => {valor + 1
                        alert(valor)});

    setValor((valor) => {valor - 5
                         alert(valor)});
  }

  return (
    <div className="App">
      <Button variant="contained" onClick={incrementar}>Text</Button>
      <p>{valor}</p>
    </div>
  );
}

export default App;
